        }
    } */

    deconnection(e) {
        const action = { type: "DECONNECT", value: e }
        this.props.dispatch(action)
    }


    render() {
        return (
            <div>
                <div>
                    <p>dashBoard</p>
                    <button onClick={() => this.deconnection()}>deconnexion</button>
                </div>
                {/* {this.renderRedirect()} */}
            </div>
        )
    }
}
const mapStateToProps = (state) => {
    return {
        client: state
    }
}
export default connect(mapStateToProps)(DashBoard)
